import React from "react";
import "./Subheader.css";

class Subheader extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <ul>
        <li>
          <a>Dashboard</a>
        </li>

        <li>
          <a>Appointments</a>
        </li>
        <li>
          <a>Workshops</a>
        </li>
        <li>
          <a>Classes</a>
        </li>
        <li>
          <a>Sign In</a>
        </li>
        <li>
          <a className="active">Business Overview</a>
        </li>
      </ul>
    );
  }
}

export default Subheader;
